using System;using System.Collections.Generic;using System.Text.Json.Serialization;namespace MicroFeel.Yonyou.Api{	public class Unit	{		///<Summary>		///计量单位编码		///</Summary>		[JsonPropertyName("code")]		public string Code { get;set; }		///<Summary>		///计量单位名称		///</Summary>		[JsonPropertyName("name")]		public string Name { get;set; }		///<Summary>		///计量单位组编码		///</Summary>		[JsonPropertyName("group_code")]		public string GroupCode { get;set; }		///<Summary>		///主计量单位标识		///</Summary>		[JsonPropertyName("main_flag")]		public string MainFlag { get;set; }		///<Summary>		///换算率		///</Summary>		[JsonPropertyName("changerate")]		public string Changerate { get;set; }		///<Summary>		///时间戳		///</Summary>		[JsonPropertyName("timestamp")]		public string Timestamp { get;set; }	}}